import React, { Component } from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import Header from '../template/Header';
import Mainmessage from '../template/Mainmessage';
import Sarchbar from '../template/Sarchbar';
import Skiarea_list from './Skiarea_list';
import Buttun from '../template/Buttun';

class App extends Component {

  render() {
    return (
      <BrowserRouter>
      <div className='main'>
        <Header />
      </div>
      <Switch>
        <Route exact path='/' component={Mainmessage} />
        <Route exact path='/' component={Sarchbar} />
        <Route exact path='/' component={Buttun} />
        <Route  path='/skiarea' component={Skiarea_list} />
      </Switch>

      </BrowserRouter>
    );
  }
}

export default App;
